import React from 'react'
import { TeamData } from '../data/TeamData'
const Team = () => {
  return (
    <div>
      <header id="page-header">
        <div className="page-heading">
          <h2>Team</h2>
          {TeamData.map(item=>{
            return(
              <div>{item}</div>
            )
          })}
        </div>
      </header>
    </div>
  )
}

export default Team
